angular.module('hapi-learning')
    .controller('AdminCtrl', [
        '$scope',
        'TeachersFactory',
        'UsersFactory',  function ($scope, TeachersFactory, UsersFactory) {

        $scope.user = {};
        $scope.usersFileNotValid = false;
        $scope.usersFileContent = null;
        $scope.countAddedUsers = null;
        $scope.schemaNotValid = false;
        $scope.conflicts = false;

        $scope.removeNotValidError = function() {
            $scope.usersFileNotValid = false;
            $scope.schemaNotValid = false;
            $scope.conflicts = false;
        };

        $scope.resetUploadUsers = function() {
            $scope.removeNotValidError();
            $scope.usersFileContent = null;
        };

        $scope.removeCountAddedUsers = function() {
            $scope.countAddedUsers = null;
        };

        $scope.uploadUsers = function() {
            if ($scope.usersFileContent) {
                UsersFactory
                    .create($scope.usersFileContent)
                    .then(function(res) {
                        $scope.countAddedUsers = res.count;
                        $scope.resetUploadUsers();
                    })
                    .catch(function(err) {
                        if (err.status === 400) {
                            $scope.schemaNotValid = true;
                        } else if (err.status === 409) {
                            $scope.conflicts = true;
                        }
                    });
            }
        };

        $scope.showUsersFileContent = function(content) {
            try {
                $scope.usersFileContent = JSON.parse(content);
                $scope.usersFileNotValid = false;
            } catch(err) {
                $scope.usersFileNotValid = true;
            }
        };

        $scope.loadTeachers = function ($query) {
            return TeachersFactory.load()
                .then(function (teachers) {

                    return teachers.filter(function (teacher) {

                        var username  = teacher.username.toLowerCase();
                        var firstName = teacher.firstName.toLowerCase();
                        var lastName  = teacher.lastName.toLowerCase();
                        var query     = $query.toLowerCase();

                        return username.indexOf(query) != -1 ||
                            firstName.indexOf(query) != -1 ||
                            lastName.indexOf(query) != -1;
                    });
                })
                .catch(function (error) {
                    console.log(error);
                });
        };
    }]);

'use strict';

angular.module('hapi-learning')
    .controller('CourseCtrl', [
        '$rootScope',
        '$scope',
        '$stateParams',
        'CoursesFactory',
        'LoginFactory',
        'FilesFactory',
        '$state',
        'Restangular',
        '$http',
    function ($rootScope, $scope, $stateParams, CoursesFactory, LoginFactory,
            FilesFactory, $state, Restangular, $http) {

            $scope.$state = $state; // for the active class

            $scope.update = false;
            $scope.course = null;
            $scope.editing = false;
            $scope.errorPostHomepage = null;



            // If stateParams changed, update course
            if ($scope.course && $stateParams.code !== $scope.course.code) {
                $scope.update = true;
            }

            if (!$scope.course || $scope.update) {

                CoursesFactory.loadSpecific($stateParams.code)
                    .then(function (course) {
                        if (course) {
                            $scope.course = course;
                            Restangular
                                .service('courses')
                                .one(course.code)
                                .one('homepage')
                                .get()
                                .then(function (readme) {
                                    $scope.course.description = readme || '*This page is empty*';
                                })
                                .catch(function (error) {
                                    if (error.status === 404)
                                    {
                                        $scope.course.description = '*This page is empty*';
                                    }
                                    else
                                    {
                                        console.log(error);
                                    }
                                });
                        }
                        else {
                            $state.go('root.home');
                        }
                    })
                    .catch(function (error) {
                        $state.go('root.home');
                    });
            };

            $scope.editHomepage = function() {
                $scope.editing = true;
            };


            $scope.saveEdit = function(content) {
                Restangular
                    .one('courses', $scope.course.code)
                    .customPOST({
                        content: content
                    },
                    'homepage').then(function(res) {
                        $scope.course.description = content;
                        $scope.editing = false;
                        $scope.errorPostHomepage = null;
                    }).catch(function() {
                        $scope.editing = true;
                        $scope.errorPostHomepage = 'Error saving the homepage';
                    });
            };

            $scope.cancelEdit = function() {
                $scope.editing = false;
                $scope.errorPostHomepage = null;
            };


    }]);

